--
-- Disparadores `reg_repuestos_informes`
--
DELIMITER $$
CREATE TRIGGER `trg_regrep_validar_update` BEFORE UPDATE ON `reg_repuestos_informes` FOR EACH ROW BEGIN
    IF (NEW.informe_correctivo_id IS NULL AND NEW.informe_preventivo_id IS NULL)
       OR (NEW.informe_correctivo_id IS NOT NULL AND NEW.informe_preventivo_id IS NOT NULL) THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Debe asignar SOLO informe_correctivo_id o SOLO informe_preventivo_id';
    END IF;
END
$$
DELIMITER ;

