--
-- Estructura para la vista `vw_kardex_repuesto`
--
DROP TABLE IF EXISTS `vw_kardex_repuesto`;

CREATE ALGORITHM=UNDEFINED DEFINER=`teqmedcl`@`localhost` SQL SECURITY DEFINER VIEW `vw_kardex_repuesto`  AS SELECT `ms`.`id` AS `id`, `ms`.`repuesto_id` AS `repuesto_id`, `r`.`serie` AS `serie`, `r`.`nombre` AS `nombre`, `ms`.`tipo` AS `tipo`, `ms`.`cantidad` AS `cantidad`, `ms`.`stock_anterior` AS `stock_anterior`, `ms`.`stock_nuevo` AS `stock_nuevo`, `ms`.`usuario_id` AS `usuario_id`, `ms`.`referencia_tipo` AS `referencia_tipo`, `ms`.`referencia_id` AS `referencia_id`, `ms`.`created_at` AS `created_at`, sum(case when `ms`.`tipo` = 'entrada' then `ms`.`cantidad` else -`ms`.`cantidad` end) over ( partition by `ms`.`repuesto_id` order by `ms`.`created_at`,`ms`.`id` rows between  unbounded  preceding and  current row ) AS `saldo_acumulado` FROM (`movimientos_stock` `ms` join `repuestos` `r` on(`r`.`id` = `ms`.`repuesto_id`)) ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_ultimo_movimiento_repuesto`
--
DROP TABLE IF EXISTS `vw_ultimo_movimiento_repuesto`;

CREATE ALGORITHM=UNDEFINED DEFINER=`teqmedcl`@`localhost` SQL SECURITY DEFINER VIEW `vw_ultimo_movimiento_repuesto`  AS SELECT `t`.`id` AS `id`, `t`.`repuesto_id` AS `repuesto_id`, `t`.`tipo` AS `tipo`, `t`.`cantidad` AS `cantidad`, `t`.`stock_anterior` AS `stock_anterior`, `t`.`stock_nuevo` AS `stock_nuevo`, `t`.`usuario_id` AS `usuario_id`, `t`.`referencia_tipo` AS `referencia_tipo`, `t`.`referencia_id` AS `referencia_id`, `t`.`created_at` AS `created_at`, `t`.`rn` AS `rn` FROM (select `ms`.`id` AS `id`,`ms`.`repuesto_id` AS `repuesto_id`,`ms`.`tipo` AS `tipo`,`ms`.`cantidad` AS `cantidad`,`ms`.`stock_anterior` AS `stock_anterior`,`ms`.`stock_nuevo` AS `stock_nuevo`,`ms`.`usuario_id` AS `usuario_id`,`ms`.`referencia_tipo` AS `referencia_tipo`,`ms`.`referencia_id` AS `referencia_id`,`ms`.`created_at` AS `created_at`,row_number() over ( partition by `ms`.`repuesto_id` order by `ms`.`created_at` desc,`ms`.`id` desc) AS `rn` from `movimientos_stock` `ms`) AS `t` WHERE `t`.`rn` = 1 ;

